import classNames from 'classnames';

const BreadcrumbItem = {
  props: {
    tag: {
      type: String,
      default: "li"
    },
    active: {
      type: Boolean,
      default: false
    }
  },
  computed: {
    className() {
      return classNames(
        'breadcrumb-item',
        this.active ? 'active' : ''
      );
    }
  }
};

export default BreadcrumbItem;
export { BreadcrumbItem as mdbBreadcrumbItem };
